VALUES ('8000643000384', 'biscotti lagaccio', 'PASTICCERI DI QUALITÀ DAL 1885 biscotti del lagaccio SENZA ZUCCHERI AGGIUNTI BISCOTTI A LIEVITAZIONE NATURALE SENZA ZUCCHERI AGGIUNTI CON EDULCORANTE - CONTIENE IN NATURA ZUCCHERI INGREDIENTI: Farina di frumento 57%, lievito madre naturale 30% (farina di frumento, acqua), edulcorante: isomalto, burro, aromi naturali, lievito di birra. Può contenere: soia, uova, frutta a guscio, arachidi. Un consumo eccessivo può avere effetto lassativo. Conservare in luogo fresco ed asciutto e non esporre ai raggi solari. NATURALLY LEAVENED BISCUITS WITHOUT ADDED SUGAR WITH ARTIFICIAL SWEETENER - NATURAL SUGAR CONTENT INGREDIENTS: Wheat flour 57%, sourdough 30 % (wheat flour, water), sweetener: isomalt, butter, natural flavors, brewer\'s yeast. May contain: soy, eggs, nuts, peanuts. Excessive consumption may have a laxative effect. Store in a cool, dry place away from direct light. BISCUITS AU LEVAIN NATUREL SANS SUCRES AJOUTÉS AVEC ÉDULCORANT - CONTIENT NATURELLEMENT DES SUCRES INGREDIENTS : Farine de froment 57%, levain-chef naturel 30% (farine de blé, eau), édulcorant: isomalt, beurre, arômes naturels, levure de bière. Peut contenir soja, oeufs, fruits à coque, arachides. Une consommation excessive peut avoir un effet laxatif. Conserver à un endroit frais et sec et ne pas exposer aux rayons du soleil. GEBÄCK MIT NATÜRLICHER GÄRUNG OHNE ZUCKERZUSATZ MIT ZUTATEN: Weizenmehl 57%, Natursauerteig 30% (Weizenmehl, Wasser), Süß SÜBUNGSMITTEL ENTHÄLT VON NATUR AUS ZUCKER somalt, Butter, natürliche Aromen, Bierhefe. Kann enthalten: Soja, Ei, Schalenfrün KON nd wirken.', 'https://static.openfoodfacts.org/images/products/800/064/300/0384/front_it.4.400.jpg', '10.8', '7', '72', '0.5', '2.9', '10.2', '0.3048', '0.12', '', '1');

